import styled from "styled-components";

const LandingContainer = styled.section`
  display: flex;
  height: 80vh;
  flex-direction: column;
  justify-content: space-between;
  margin: 0;
`;

const LandingWrapper = styled.section`
  display: flex;
  flex-direction: column;
  text-align: center;
`;

export { LandingContainer, LandingWrapper };
